//Request para verificar que un nombre de usuario existe
import {BASIC_URL} from './../constants'
import axios from 'axios'

export async function getLogin({email,password}){
    //return axios.get(`${BASIC_URL}/login?username=${username}&&password=${password}`)
    try{
        console.log(await axios.post(`${BASIC_URL}/login/signin`,{email, password}))
        const getObj = await axios.post(`${BASIC_URL}/login/signin`,{email, password})
        console.log('GET OBJ')
        console.log(getObj)
        return getObj.data
    }
    catch(e){
        return e.response
    }
}
